import { StarConstellation } from "../types/types";

const getAllConstellationsForStar = (id: number) => {
  let constellations: StarConstellation | undefined;

  const fetchData = async () => {
    try {
      const apiResponse = await fetch(
        `http://localhost:777/GetAllConstellationsForStar/${id}`,
        {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
          },
        }
      );
      const json = await apiResponse.json();
      constellations = json.constellations;
    } catch (e) {
      console.log(e);
    }
  };
  return constellations;
};

export default getAllConstellationsForStar;
